Their botched withdrawal from Afghanistan resulted in the deaths of 13 American service members and emboldened our adversaries. On this Administration’s watch, Vladimir Putin invaded Ukraine and Hamas carried out a deadly attack on Israel. Around the world, our enemies no longer fear us.

@HouseGOP is focused on reimplementing a successful peace through strength agenda. America must lead on the world stage again.

